import React from 'react'
import logoImg from '../../../assets/images/logo.png'

const logo =(props)=>(
    <div className="col-lg-4 navigation__is-logo">
        
            <img className="navigation__logo--img" src={logoImg} alt="MyBurger"/>
        
    </div>
);

export default logo;
